import { Link } from "react-router-dom";
import { useState, useEffect } from "react";
import APIURL from "./APIURL";
import("./Directory.scss");

const Directory = () => {
    const [shelters, setShelters] = useState([]);

    useEffect(() => {
        const makeAPICall = async () => {
            const response = await fetch(`${APIURL}/directory`);

            const data = await response.json();
            console.log("data", data);
            setShelters(data.shelterDirectory);
        };
        makeAPICall();
    }, []);
    const searchShelters = async (event) => {
        event.preventDefault();

        const response = await fetch(`${APIURL}/sheltersSearch`, {
            headers: {
                "Content-Type": "application/json",
            },
            body: JSON.stringify({
                query: event.target.elements.searchInput.value,
            }),
            method: "POST",
        });

        const data = await response.json();
        setShelters(data.shelters);
    };

    return (
        <div>
            <div className="container" id="Directory">
                <div className="row">
                    <div className="col-8">
                        <h1>
                            <Link to="/">Find Your Furever Friend</Link>
                        </h1>
                    </div>
                    {/* <!-- end of Find col --> */}
                    <div className="col-2">
                        <h6>
                            <Link to="/CreateShelterAccount">
                                Create Account
                            </Link>
                        </h6>
                    </div>
                    {/* <!-- end of adopters col --> */}
                    <div className="col-2">
                        <h6>
                            {" "}
                            <Link to="/ShelterSignin">Signin</Link>{" "}
                        </h6>
                    </div>
                    {/* <!-- end of shelters col --> */}
                </div>
                {/* <!-- end of row 1 --> */}
                <div className="row" id="col-names">
                    <div className="col-3">
                        <h5>Shelter Name</h5>
                    </div>
                    <div className="col-3">
                        <h5>Phone Number</h5>
                    </div>
                    <div className="col-3">
                        <h5>Address</h5>
                    </div>
                </div>
                <hr />
                <div className="row">
                    <div className="col-3">
                        <h6 id="name">Pawsitivitea CNY Cafe & Cat Lounge</h6>
                    </div>
                    <div className="col-3">
                        <h6 id="phoneNumber">315-807-8936</h6>
                    </div>
                    <div className="col-3">
                        <h6 id="address">
                            2100 Park St <br />
                            Syracuse, NY 13208
                        </h6>
                    </div>
                    <div className="col-3">
                        <button type="button">
                            <Link to="/CreateShelterAccount">
                                Claim Your Business
                            </Link>
                        </button>
                    </div>
                </div>
                {/* <!-- end of row 2 --> */}
                <div className="row">
                    <div className="col-3">
                        <h6 id="name">Helping Hounds Dog Rescue</h6>
                    </div>
                    <div className="col-3">
                        <h6 id="phoneNumber">315-446-5970</h6>
                    </div>
                    <div className="col-3">
                        <h6 id="address">
                            7268 Caswell Ave <br />
                            North Syracuse, NY 13212
                        </h6>
                    </div>
                    <div className="col-3">
                        <button type="button">
                            <Link to="/CreateShelterAccount">
                                Claim Your Business
                            </Link>
                        </button>
                    </div>
                </div>
                {/* <!-- end of row 3 --> */}
                {/* <div className="row">
                    <div className="col-3">
                        <h6 id="name">Second Chance Canine Adoption</h6>
                    </div>
                    <div className="col-3">
                        <h6 id="phoneNumber">315-435-5584</h6>
                    </div>
                    <div className="col-3">
                        <h6 id="address">
                            6660 E Seneca Turnpike <br />
