                        </h6>
                    </div>
                    <div className="col-3">
                        <button type="button">
                            <Link to="/CreateShelterAccount">
                                Claim Your Business
                            </Link>
                        </button>
                    </div>
                    {/* <!-- end of row 4 --> */}
            </div>
            {/* <!-- end of container-fluid --> */}
        </div>
    );
};

export default Directory;
